(55512, 'F1818688-F7BA-4EDD-A4BA-A2173F22A32D', 'Love, I’m sorry that me telling you that I didn’t feel in a space to plan our wedding made you feel hurt and disconnected. I want to move through this with you and get to the other side. I have been feeling disconnected since last week too…after having a pretty intense session last week…and then not having time to talk to you, or reflect or reconnect…and then going right to planning a wedding….felt really off. My body just responded with surprise and caution. I absolutely do want to have and want to plan a wedding with you. I don’t expect that there will be some magical moment where all of a sudden we will have worked through everything and THEN it will be ok. I recognize that this is life’s work and that we will have different ways of seeing and experiencing things and….that this is essential to both of us growing individually and together. When I said I felt hopeful last week it was because I truly felt and believe that this work can and will continue.     ', '683767139642000000', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2022-09-01T16:18:59.642000'),
