(55532, 'F106797C-E5D1-42D6-9660-76B21917167E', 'Love, I know we’ve had difficult conversations the last 12 hrs and that we are both feeling sad and disconnected. I know you feel hurt by me and Im sorry that my mixed signals about planning our wedding right now is causing you pain. I think we are almost there but I need to work through with you the strong signals I felt when we started discussing the plans.  I love and adore you deeply. I choose you today for your strength, your depth of character, your compassion for others and your beautiful humanity. I feel grateful and blessed to be your partner, and I am with you every step of our path together…be it unconventional, sometimes scary and difficult. I am truly looking forward to planning a beautiful wedding together….I want it too. I love you and all your parts and all of our messiness.', '683827733500844032', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2022-09-02T09:08:53.500844'),
