(55608, 'D63107F2-B2FD-4B67-A28E-972E9D6F61D4', 'You asked me what I️ would suggest to do if we were going to reconnect. A few hours later, I️ suggested that you plan a nice date for us. If what I️ suggest is going to be refuted by with “you can do that for me” then we are never going to get out of this cycle. I don’t want to be disconnected but in the last few days you have really hurt me many times. I️ get that you feel hurt too - but I️ am not the one who cussed you out, I️’m not the one who said I️ didn’t want to plan a wedding. I️’m not in a place to break the disconnection. I told you that i feel deflated today. I️ can’t just bounced back because apologize. I️ told you two days ago I️ needed more affection and love. If you don’t want to give it to me, fine. But I️’m not in a place where I️ can do that without some initiative from you. If that doesn’t work for you, we can just stay disconnected and maybe it will just naturally change with some time. I️ don’t know. But what I️ know is that I️’m in a lot of pain right now and I️ can’t find space to be generous without some help from you.', '683961112862632704', '683963554282803968', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', '+19172390518', '2022-09-03T22:11:52.862633'),
