(55740, '9BCE0173-4707-480F-ACEC-D805FCBD87D1', 'Hey love, just want to share my appreciation to you for being open, willing to have hard conversations with me and being committed to working through difficult stuff respectfully. I know it is hard to not let our defenders Take over in these conversations…and I’m still working to stay grounded even while feeling strong emotions. Yes, this is life’s work and I feel so so grateful….even during difficult moments….to have you as my co-adventurer. We are down in the deep dark parts of The forest here.  I know that you consider me, are looking out for my interests, and are working hard on your own and with me to be a better partner, mother and human. I love you so much. ', '684288821494005888', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2022-09-07T17:13:41.494006'),
