(55805, '98C54599-02C1-4949-94CA-944130D5F21E', 'Hey love, just want to share that I’m feeling down today and tired. Lost sleep last night thinking about our non-monogamy situation and what doesn’t sit well with me. I’m trying to find a path to really both tolerate your form of non-monogamy and mitigate the impact it has on my feelings.  It would be helpful to me to hear your appreciation for my efforts to bend really far for you.  Instead, I just feel sad and distant because I can’t discuss this with you openly without being told that I’m being judgmental.', '684365677224000000', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2022-09-08T14:34:37.224000'),
